import React from 'react';
import { Link } from 'react-router-dom';
const DUMMY_EVENTS = [
    {
        id: 'e1',
        title: 'Some Event'
    },
    {
        id: 'e2',
        title: 'Another Event'
    }
]

const EventsPage = () => {
    return (
        <>
            <h1>Event Page</h1>
            <ul>
                {DUMMY_EVENTS.map((item)=><li key={item.id}><Link to={item}>{item.title}</Link></li>)}
            </ul>
        </>
    );
}

export default EventsPage;
